import React from 'react';

const SideBar = () => {
    return (<>
        <div className="col-md-2 d-md-block d-none p-0">
            <div className="card ml-0 pl-0">
                <div className="card-body"></div>
            </div>
        </div>
    </>);
}

export default SideBar;
